import React from 'react';
import Card from '@mui/material/Card';
import CardActions from '@mui/material/CardActions';
import CardContent from '@mui/material/CardContent';
import CardMedia from '@mui/material/CardMedia';
import Button from '@mui/material/Button';
import Typography from '@mui/material/Typography';
export default function House(props) {
  return (
      <div className=" p-3 rounded-lg flex flex-row sm:columns-3xs  border hover:shadow-lg ease-linear transition-all duration-150">
        <div className="flex flex-col w-full sm:w-fit text-center sm:text-start mt-2 sm:mt-0 sm:ml-4 md:mx-6 sm:py-2">
        <div className="flex max-w-4/12">
          <picture className="max-w-[500px] aspect-square m-2">
            <img
              src={`${props.url}`}
              loading="lazy"
              className="w-full h-full rounded-full shadow-lg object-cover"
            />
          </picture>
        </div>
        </div>
        <div className="flex flex-col w-full sm:w-fit text-center sm:text-start mt-2 sm:mt-0 sm:ml-4 md:mx-6 sm:py-2">
        <Card sx={{ maxWidth: 500 }}>
      <CardContent>
        <Typography gutterBottom variant="h5" component="div">
        {props.name}
        </Typography>
        <Typography variant="body2" color="text.secondary">
        {props.intro}
        </Typography>
      </CardContent>
      <CardActions>
        <Button size="small">{props.score.toFixed(1)}</Button>
        <Button size="small">{props.price}</Button>
      </CardActions>
    </Card>
        </div>
      </div>
  );
}
